import * as React from 'react';
import ResponsiveAppBar from "../components/appbar";
import Container from "@mui/material/Container";
import  Hero  from '../assets/hero.jpg';


function Anasayfa(){
return(
    <div>
    <ResponsiveAppBar/>
    <img src={Hero} alt="Hero"/>
    </div>

   
);};
export default Anasayfa;
